import React, { useEffect } from 'react';
import axios from 'axios';
import './App.css';

const App = () => {

  const [stationList, setStationList] = useState([])

  useEffect(() => {
    axios.get(`${process.env.REACT_APP_API}/jStations?L&api_key=${process.env.REACT_APP_SECRET}`)
      .then((data) => setStationList(data));
  }, [])

  return (
    <div className="App">
      <input>

      </input>
    </div>
  );
}

export default App;
